import React from "react";

class PostForm extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>Add Post</h1>
        <form>
          <div>
            <label>Title</label> <br />
            <input type="text" placeholder="" />
          </div>
          <br />
          <div>
            <label>Body</label> <br />
            <textarea cols="30" rows="10" />
          </div>
          <br />
          <button type="submit">Submit</button>
        </form>
      </React.Fragment>
    );
  }
}
export default PostForm;
